import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const OrdensServico = () => {
  const [ordens, setOrdens] = useState([]);
  const [statusFiltro, setStatusFiltro] = useState('');
  const [dataFiltro, setDataFiltro] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    // Mock de dados
    setOrdens([
      {
        id: 1,
        numero_protocolo: 'OS2025001',
        equipamento: 'Bomba de Infusão',
        cliente: 'Hospital Santa Clara',
        nome_solicitante: 'João da Silva',
        nome_tecnico: 'Carlos Souza',
        tipo_visita: 'Preventiva',
        modalidade: 'Presencial',
        status: 'Aberta',
        data_abertura: '2025-05-05',
        data_agendamento: '2025-05-10'
      },
      {
        id: 2,
        numero_protocolo: 'OS2025002',
        equipamento: 'Desfibrilador',
        cliente: 'Clínica Vida',
        nome_solicitante: 'Maria Oliveira',
        nome_tecnico: 'Lucas Ramos',
        tipo_visita: 'Corretiva',
        modalidade: 'Remoto',
        status: 'Concluída',
        data_abertura: '2025-05-02',
        data_agendamento: '2025-05-04'
      }
    ]);
  }, []);

  // Filtro aplicado
  const ordensFiltradas = ordens.filter(ordem => {
    return (
      (!statusFiltro || ordem.status === statusFiltro) &&
      (!dataFiltro || ordem.data_abertura === dataFiltro)
    );
  });

  return (
    <div style={{ padding: '20px' }}>
      <h2>Ordens de Serviço</h2>

      <div style={{ marginBottom: '20px', display: 'flex', gap: '10px', alignItems: 'center' }}>
        <label>Status:</label>
        <select value={statusFiltro} onChange={(e) => setStatusFiltro(e.target.value)}>
          <option value="">Todos</option>
          <option value="Aberta">Aberta</option>
          <option value="Em andamento">Em andamento</option>
          <option value="Concluída">Concluída</option>
        </select>

        <label>Data de Abertura:</label>
        <input type="date" value={dataFiltro} onChange={(e) => setDataFiltro(e.target.value)} />

        <button onClick={() => alert('Abrir formulário de nova OS')}>
          Nova Ordem de Serviço
        </button>
      </div>

      <table border="1" cellPadding="8" style={{ width: '100%', fontSize: '14px' }}>
        <thead>
          <tr>
            <th>ID</th>
            <th>Protocolo</th>
            <th>Equipamento</th>
            <th>Cliente</th>
            <th>Solicitante</th>
            <th>Técnico</th>
            <th>Visita</th>
            <th>Modalidade</th>
            <th>Status</th>
            <th>Abertura</th>
            <th>Agendamento</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {ordensFiltradas.length === 0 ? (
            <tr>
              <td colSpan="12" style={{ textAlign: 'center' }}>Nenhuma ordem encontrada</td>
            </tr>
          ) : (
            ordensFiltradas.map((ordem) => (
              <tr key={ordem.id}>
                <td>{ordem.id}</td>
                <td>{ordem.numero_protocolo}</td>
                <td>{ordem.equipamento}</td>
                <td>{ordem.cliente}</td>
                <td>{ordem.nome_solicitante}</td>
                <td>{ordem.nome_tecnico}</td>
                <td>{ordem.tipo_visita}</td>
                <td>{ordem.modalidade}</td>
                <td>{ordem.status}</td>
                <td>{ordem.data_abertura}</td>
                <td>{ordem.data_agendamento}</td>
                <td>
                  <button onClick={() => navigate(`/ordensservico/${ordem.id}`)}>Ver</button>
                  <button onClick={() => navigate(`/ordensservico/editar/${ordem.id}`)}>Editar</button>
                </td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default OrdensServico;
